import React from "react";
import crockpot from "../img/crockpot_logo.png"

const NavBar = props => {
    return (
        <header>
            <div className="nav-wrap">
                <img className="logo" src={crockpot}/>
                <div className="header-text"><h1>Soup Kitchen</h1>
                <h3>Admin Panel</h3></div>

                <nav>

                </nav>
            </div>
        </header>
    )
}

export default NavBar;
